import './App.css';
import React, {useEffect,useState} from 'react'

function App() {
  const [backendData,setBackendData]=useState([{}])
  useEffect(()=> {
    fetch("/api").then(response=>response.json()).then(data => {setBackendData(data)})
  },[]);

  return (
    <div>
      <label>{backendData["users"]}</label>
    </div>
  );
}

export default App;
